# Definition for a binary tree node.# class TreeNode:#     def __init__(self, x):#         self.val = x#         self.left = None#         self.right = Noneclass Solution:    def zigzagLevelOrder(self, root):        """        :type root: TreeNode        :rtype: List[List[int]]        """        if not root:            return []        level1,level2,nums,ans=[],[],[],[]        level1.append(root)        level=0        while level1 or level2:            while level1:                temp=level1[-1]                nums.append(temp.val)                level1.pop()                if level%2==0:                    if temp.left:                        level2.append(temp.left)                    if temp.right:                        level2.append(temp.right)                if level%2==1:                    if temp.right:                        level2.append(temp.right)                    if temp.left:                        level2.append(temp.left)            level+=1            ans.append(nums.copy())            level1=level2.copy()            level2.clear()            nums.clear()        return ans 